import React from 'react'

const AddTaskListForm = ({setTaskList}) => {

  const formSubmit = e =>{
    e.preventDefault();
  }

  const closeHandler = e => {
    setTaskList(false)
  }
  return(
    <div className="add-task-list-form">
      <form>
        <label>Input name new dashboard</label>

        <input className="column-title"></input>

        <div className="form-footer">

          <button className="add-column-btn" 
                  type="submit" 
                  onClick={formSubmit}>Add</button>

          <button className="close" 
                  type="button" 
                  onClick={closeHandler}>
            &times;
          </button>

        </div>
      </form>
    </div>
  )
}


export default AddTaskListForm;
